    </head>
    <body>
        <nav class=\"navbar navbar-expand-lg navbar-dark bg-dark\">
            <a class=\"navbar-brand\" href=\"{{ path ('home')}}\">Reservation</a>
            <button class=\"navbar-toggler\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarSupportedContent\" aria-controls=\"navbarSupportedContent\" aria-expanded=\"false\" aria-label=\"Toggle navigation\">
                <span class=\"navbar-toggler-icon\"></span>
            </button>

            <div class=\"collapse navbar-collapse\" id=\"navbarSupportedContent\">
                <ul class=\"navbar-nav mr-auto\">
                <li class=\"nav-item\">
                    <a class=\"nav-link {% if current_menu is defined and  current_menu == 'show'%} active {% endif %}\" href=\"{{ path ('show')}}\">show</a>
                </li>
            </div>
            {% if app.user %}
            <a href=\"{{ path('app_logout') }}\" class=\"btn btn-outline-success my-2 my-sm-0\" >deconexion</a>
            {% endif %}
            {% if app.user is null %}
            <a href=\"{{ path('app_login') }}\" class=\"btn btn-outline-success my-2 my-sm-0\" >conexion</a>
            {% endif %}
        </nav>
        {% block body %}{% endblock %}
        {% block javascripts %}
        <script src=\"https://code.jquery.com/jquery-3.2.1.slim.min.js\" integrity=\"sha384-KJ3o2DKtIkvYIK3UENzmM7KCkRr/rE9/Qpg6aAZGJwFDMVNA/GpGFF93hXpG5KkN\" crossorigin=\"anonymous\"></script>
